import * as React from 'react'

import { Navbar, Nav, NavItem, NavDropdown, MenuItem } from 'react-bootstrap'

import { NavLink } from 'react-router-dom'

class MyHeader extends React.Component {

    render() {
        return (
            <Navbar>
                <Navbar.Header>
                    <Navbar.Brand>
                        <a href="#brand">Sistema de Produção</a>
                    </Navbar.Brand>
                    <Navbar.Toggle />
                </Navbar.Header>
                <Nav>
                    <NavItem eventKey={1} href="/operacional"><NavLink to={'/operacional'} activeStyle={{
                        textDecoration: 'none',
                        color: 'black'
                    }}>Operacional</NavLink></NavItem>
                    <NavItem eventKey={2} href="/tatico"><NavLink to={'/tatico'} activeStyle={{
                        textDecoration: 'none',
                        color: 'black'
                    }}>Tático</NavLink></NavItem>
                    <NavItem eventKey={2} href="/estrategico"><NavLink to={'/estrategico'} activeStyle={{
                        textDecoration: 'none',
                        color: 'black'
                    }}>Estratégico</NavLink></NavItem>
                </Nav>
            </Navbar>
        )
    }
}

/*
<Link href={'/operacional'}>Operacional</Link>
                        <Nav.link href={'/tatico'}>Tático</Nav.link>
                        <Nav.link href={'/estrategico'}>Estratégico</Nav.link>
*/

export default MyHeader
